INSERT INTO euro_texts (`id`, `text_name`, `text_en`, `text_nl`, `text_default`) VALUES (1, 'text_welcome_not_logged_in', '<h2>Welcome to [[poolname]], version [[version]].</h2><p>This is a prediction game for Euro 2012. To join the fun, please <a href=\"signup\">create an account</a>, and start predicting the results.</p><h4>With these predictions, you can earn points&#58;</h4><ul><li>Correct goals for the home team or away team&#58; <strong>[[points_for_goals]] points</strong>.</li><li>Correct result (win-draw-loss)&#58; <strong>[[points_for_wdl]] points</strong>.</li><li>Prediction of the<strong> exact</strong> outcome of a match give you <strong>[[points_for_exact_score]] bonus points</strong>.</li></ul><p>You can change your prediction for these reults until the match starts. So if a team does not perform as you thought it would, you have time to correct your predictions during the tournament.</p><p>In the knockout phase of the tournament, you can earn extra points by predicting the teams that will reach the quarter finals, semi finals and the final. <u><em>To keep these predictions honest, you will have to predict the teams before the tournament starts.</em></u></p><ul><li>A team correct in the quarter finals&#58;<strong> [[points_for_team_qf]] points</strong>.</li><li>A team correct in the semi finals&#58;<strong> [[points_for_team_sf]] points</strong>.&nbsp;</li><li>A team correct in the final&#58; <strong>[[points_for_team_f]] points</strong>.</li></ul><p>Whoever has the most points after the tournament is over, wins the game.</p><p>Good luck!</p>', '<h2>Welkom bij [[poolname]], versie [[version]].</h2><p>Dit is een voetbal pool voor het Europees Kampioenschp Voetbal in 2012. Om mee te kunnen doen, moet je eerst&nbsp;<a href=\"signup\">een account aanmaken</a>, daarna kun je voorspelling in gaan vullen.</p><h4>Met deze voorspellingen kun je punten scoren&#58;</h4><ul><li>Correct aantal doelpunten voor uit- of thuisploeg&#58;&nbsp;<strong>[[points_for_goals]] punten</strong>.</li><li>Correct toto resultaat (winst-gelijk-verlies)&#58;&nbsp;<strong>[[points_for_wdl]] punten per wedstrijd</strong>.</li><li>Als je de uitslag van een wedstrijd exact voorspeld hebt, krijg je ook nog eens&nbsp;<strong>[[points_for_exact_score]] bonus punten</strong>.</li></ul><p>Je kunt de voorspelling van de uitslag van een wedstrijd wijzigen tot de wedstrijd begint. Als een land dus niet zo sterk blijkt te presteren als je aanvankelijk dacht, heb je nog de tijd om je voorspellingen te wijzigen.</p><p>Na de groepsfase zijn er ook nog punten te verdienen door de juiste landen in de kwart- en halve finales en de finale te voorspellen. <u><em>Om het allemaal zo eerlijk mogelijk te houden, moet je deze voorspellingen doen v&oacute;&oacute;rdat het toernooi begint.</em></u></p><ul><li>Een land goed voorspeld in de kwart finale&#58;<strong>&nbsp;[[points_for_team_qf]] punten</strong>.</li><li>Een land goed voorspeld in de halve finale&#58;<strong>&nbsp;[[points_for_team_sf]]&nbsp;</strong><strong>punten</strong>.</li> <li>Een land goed voorspeld in de finale&#58;&nbsp;<strong>[[points_for_team_f]]&nbsp;</strong><strong>punten</strong>.</li></ul><p>Wie aan het einde van het toernooi de meeste punten heeft, wint de pool.</p><p>Succes!</p>', '<h2>Welcome to [[poolname]], version[[version]].</h2><p>This is a prediction game for Euro 2012. To join the fun, please <a href=\"signup\">create an account</a>, and start predicting the results.</p><h4>With these predictions, you can earn points&#58</h4><ul><li>Correct goals for the home team or away team: <strong>[[points_for_goals]] points</strong>.</li><li>Correct result (win-draw-loss)&#58; <strong>[[points_for_wdl]] points</strong>.</li><li>Prediction of the<strong> exact</strong> outcome of a match give you <strong>[[points_for_exact_score]] bonus points</strong>.</li></ul><p>In the knockout phase of the tournament, you can earn extra points by predicting the teams that will reach the quarter finals, semi finals and the final&#58;</p><ul><li>A team correct in the quarter finals&#58;<strong> [[points_for_team_qf]] points</strong>.</li><li>A team correct in the semi finals&#58;<strong> [[points_for_team_sf]] points</strong>.&nbsp;</li><li>A team correct in the final&#58; <strong>[[points_for_team_f]] points</strong>.</li></ul><p>Whoever has the most points after the tournament is over, wins the game.</p>');
INSERT INTO euro_texts (`id`, `text_name`, `text_en`, `text_nl`, `text_default`) VALUES (2, 'text_email_activate', '<p>Hi [[nickname]]</p><p>You have created an account for [[poolname]] at <a href=\"http&#58;//[[base_url]]\">http://[[base_url]]</a>. Please click on the following link to activate your account&#58; [[activatelink]].</p><p>If you have trouble activating your account, please contact <a href=\"mailto:[[admin_email]]?subject=Trouble with activation&body=I need help!\">the administrator</a>.</p><p>Thanks,</p><p>[[poolname]]</p>', '<p>Hoi [[nickname]]</p><p>Je hebt een account aangemaakt voor [[poolname]] op [[base_url]]. Klik even op de volgende link om je account te activeren&#58; [[activatelink]].</p><p>Als het activeren niet lukt, of je hebt andere vragen, neem dan contact op met [[admin_email]].</p><p>Bedankt,</p><p>[[poolname]]</p>', '<p>Hi [[nickname]]</p><p>You have created an account for [[poolname]] at [[base_url]]. Please click on the following link to activate your account&#58; [[activatelink]].</p><p>If you have trouble activating your account, please contact [[admin_email]].</p><p>Thanks,</p><p>[[poolname]]</p>');
INSERT INTO euro_texts (`id`, `text_name`, `text_en`, `text_nl`, `text_default`) VALUES (3, 'text_news', '<h3>\n Installation successful</h3>\n<p>\n Congratulations with the successful installation of [[poolname]]</p>\n<p>\n This spot is reserved for you, to write some news or something</p>\n', '<h3>\n Installatie succesvol</h3>\n<p>\n Gefelicteerd met de installatie van [[poolname]], [[nickname]]!</p>\n<p>\n Hier kun je zelf een nieuwsitem schrijven of iets dergelijks. In je teksten kun je de waardes van instellingen uit de &#39;settings&#39; tabel invoegen op deze manier: <span style=\"font-family:courier new,courier,monospace;\">[[setting]]</span> (als je bijvoorbeeld &#39;poolname&#39; tussen de haakjes zet, krijg je je eigen poolnaam).</p>\n<p>\n Ook kun je velden uit de &#39;users&#39; tabel op dezelfde manier invoegen, om zo de website een persoonijk tintje te geven, op deze manier: <span style=\"font-family:courier new,courier,monospace;\">[[veldnaam]]</span>. Voor &#39;veldnaam&#39; kun je bijvoorbeeld &#39;nickname&#39; invullen.</p>\n', '<h3>Installation successful</h3><p>Congratulations with the successful installation of [[poolname]]!</p><p>This spot is reserved for you, to write some news or something. You can go <a href=\"#\">here</a> to edit this text.');
